import { Route, Routes, Switch } from 'react-router-dom';

import './App.scss';

import Home from './pages/Home';

function App() {
  return (
    <>
    <Routes>
      <Switch>
        <h1>hello</h1>
        <Route exact path="/" component={ Home }/>

      </Switch>
    </Routes>
    </>
  );
}

export default App;
